INSERT INTO `tbl_item` VALUES ('402880e55c590053015c59291f6a0000','2017-05-30 19:41:26',0,'2017-05-30 19:47:54',4,'public class Solution006 {\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\n    \n         int len_1=nums1.length;\n        int len_2=nums2.length;\n        int middle=0;\n        boolean isOdd=false;\n        if((len_1+len_2)%2==0){\n            middle=(len_1+len_2)/2-1;\n            isOdd=false;\n        }else{\n            middle=(len_1+len_2)/2;\n            isOdd=true;\n        }\n        //合并排序\n        int[] num=new int[len_1+len_2];\n        int i=0,l=0,r=0;\n        while(l<len_1&&r<len_2){\n            if(nums1[l]<nums2[r]){\n                num[i]=nums1[l];\n                i++;\n                l++;\n            }else{\n                num[i]=nums2[r];\n                i++;\n                r++;\n            }\n        }\n        while(l<len_1){\n            num[i++]=nums1[l++];\n        }\n        while(r<len_2){\n            num[i++]=nums2[r++];\n        }\n\n        if(!isOdd){\n            return (double)(num[middle]+num[middle+1])/2;\n        }else{\n            return (double)num[middle];\n        }\n    }\n}','','Solution006','**问题描述**\n\nThere are two sorted arrays nums1 and nums2 of size m and n respectively.\n\nFind the median of the two sorted arrays. The overall run time complexity should be O(log (m+n)).\n\n**Example 1:**\n```\nnums1 = [1, 3]\nnums2 = [2]\n\nThe median is 2.0\n```\n\n**Example 2:**\n```\nnums1 = [1, 2]\nnums2 = [3, 4]\n\nThe median is (2 + 3)/2 = 2.5\n```','有两个有序数组，查找到连个数组中的中间值',NULL,'006',1,'findMedianSortedArrays',1,'测试',0,'public class Solution006 {\r\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\r\n      //do something;\r\n    }\r\n}','两个有序数组中间值',2,'402880e55c590053015c592ee07d0006','leetcode',NULL,NULL),('402880e55c590053015c59732071000c','2017-05-30 21:02:16',0,'2017-05-30 21:02:16',1,'public class Solution007 {\n    public String longestPalindrome(String s) {\n        int max=0;\n        int j=0;\n        //奇对称情况\n        for(int i=0;i<s.length();i++){\n            char cur=s.charAt(i);\n            boolean flag=true;\n            int index=0;\n            while(flag){\n                if(i-index<0||i+index>=s.length()){\n                    flag=false;\n                    continue;\n                }\n                if(s.charAt(i-index)==s.charAt(i+index)){\n                    index++;\n                }else{\n                    flag=false;\n                }\n            }\n            if(index>max){\n                max=index;\n                j=i-index+1;\n            }\n        }\n\n        int odd=2*(max-1)+1;\n        //偶对称\n        max=0;\n        int k=0;\n        for(int i=0;i<s.length();i++){\n            char cur=s.charAt(i);\n            if(i>0){\n                boolean flag=true;\n                int index=0;\n                while(flag){\n                    if(i-index-1<0||i+index>=s.length()){\n                        flag=false;\n                        continue;\n                    }\n                    if(s.charAt(i-index-1)==s.charAt(i+index)){\n                        index++;\n                    }else{\n                        flag=false;\n                    }\n                }\n                if(index>max){\n                    max=index;\n                    k=i-index;\n                }\n            }\n            if(i+1<s.length()){\n                boolean flag=true;\n                int index=0;\n                while(flag){\n                    if(i-index<0||i+index+1>=s.length()){\n                        flag=false;\n                        continue;\n                    }\n                    if(s.charAt(i-index)==s.charAt(i+index+1)){\n                        index++;\n                    }else{\n                        flag=false;\n                    }\n                }\n                if(index>max){\n                    max=index;\n                    k=i-index+1;\n                }\n            }\n        }\n        int even=2*max;\n        if(odd>even){\n            return s.substring(j,odd+j);\n        }else{\n            return s.substring(k,even+k);\n        }\n        \n    }\n}','','Solution007','**问题描述**\n\nGiven a string s, find the longest palindromic substring in s. You may assume that the maximum length of s is 1000.\n\n**Example 1：**\n```\nInput: \"babad\"\n\nOutput: \"bab\"\n\nNote: \"aba\" is also a valid answer.\n```\n\n**Example 2：**\n```\nInput: \"cbbd\"\n\nOutput: \"bb\"\n```','给定一个字符串，查找最长的回文子串',NULL,'007',1,'longestPalindrome',0,'测试',0,'public class Solution007 {\r\n   public String longestPalindrome(String s) \r\n      //write your code;\r\n    }\r\n}','最大回文串',1,'402880e55c590053015c597305c2000b','leetcode',NULL,NULL),('402880e55c597d0c015c59a856730000','2017-05-30 22:00:23',0,'2017-05-31 08:50:09',9,'/**\n * Definition for singly-linked list.\n * public class ListNode {\n *     int val;\n *     ListNode next;\n *     ListNode(int x) { val = x; }\n * }\n */\npublic class Solution008 {\n    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {\n        ListNode head=null;\n        ListNode current=null;\n        \n        ListNode nextNode=l1;\n        int pre=0;\n        while(nextNode!=null){\n            if(head==null){\n               head=new ListNode((l1.val+l2.val)%10+pre);\n               current=head;\n            }\n            else{\n                ListNode node=new ListNode((l1.val+l2.val)%10+pre);\n                current.next=node;\n                current=node;\n            }\n            if(current.val>=10) {\n                pre=current.val/10;\n                current.val=current.val%10;\n            }else {\n                pre = (l1.val + l2.val) / 10;\n            }\n            l1=l1.next;\n            l2=l2.next;\n            if(l1==null&&l2!=null){\n               nextNode=l2;\n               l1=new ListNode(0);\n            }\n            if(l2==null&&l1!=null){\n                nextNode=l1;\n                l2=new ListNode(0);\n            }\n            if(l1==null&&l2==null){\n                nextNode=null;\n            }\n        }\n        if(pre>0){\n            current.next=new ListNode(pre);\n        }\n       return head;\n    }\n}','public class ListNode {\n     int val;\n     ListNode next;\n     ListNode(int x) { val = x; }\n}','Solution008','**问题描述**\n\nYou are given two non-empty linked lists representing two non-negative integers. The digits are stored in reverse order and each of their nodes contain a single digit. Add the two numbers and return it as a linked list.\n\nYou may assume the two numbers do not contain any leading zero, except the number 0 itself.\n\n**Input：**\n```\n(2 -> 4 -> 3) + (5 -> 6 -> 4)\n```\n\n**Output：**\n```\n7 -> 0 -> 8\n```','给定两个非空的整数链表，每个节点存储一个整数，两个链表相加后，返回一个新的链表',NULL,'008',3,'addTwoNumbers',1,'',1,'/**\n * Definition for singly-linked list.\n * public class ListNode {\n *     int val;\n *     ListNode next;\n *     ListNode(int x) { val = x; }\n * }\n */\npublic class Solution008 {\n    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {\n        \n    }\n}','两链表相加',5,'8a8a82695c5bf692015c5bfb26fd0003','leetcode',NULL,NULL),('402880ed5c30127b015c3055ae2f0001','2017-05-22 21:25:40',0,'2017-05-24 16:41:10',32,'public class Solution1 {\r\n    public int method(int[] nums) {\r\n      //do something;\r\n    }\r\n}','','Solution1','\n####问题描述\n\n一种双核CPU的两个核能够同时的处理任务，现在有n个已知数据量的任务需要交给CPU处理，假设已知CPU的每个核1秒可以处理1kb，每个核同时只能处理一项任务。n个任务可以按照任意顺序放入CPU进行处理，现在需要设计一个方案让CPU处理完这批任务所需的时间最少，求这个最小的时间。\n\n####输入描述\n```\n输入包括两行：\n第一行为整数n(1 ≤ n ≤ 50)\n第二行为n个整数length[i](1024 ≤ length[i] ≤ 4194304)，表示每个任务的长度为length[i]kb，每个数均为1024的倍数\n```\n\n####输出描述\n```\n输出一个整数，表示最少需要处理的时间\n```\n\n####输入示例\n\n```\n5\n3072 3072 7168 3072 1024\n```\n\n####输出示例\n```\n9216\n```','现在有n个已知数据量的任务需要交给CPU处理，假设已知CPU的每个核1秒可以处理1kb，每个核同时',NULL,'002',4,'method',100,'测试',110,'public class Solution1 {\r\n    public int method(int[] nums) {\r\n      //do something;\r\n    }\r\n}','大数相乘',135,'402880ed5c30127b015c305564a30000','',NULL,NULL),('402881925c3fa5c4015c3ff0bd470001','2017-05-25 22:09:20',0,'2017-05-27 17:38:29',32,'public class TwoSum {\n      public int[] main(int[] nums, int target) {\n        int[] ret=new int[2];\n        boolean flag=false;\n        for(int i=0;i<nums.length;i++){\n             int a=nums[i];\n            for(int j=i+1;j<nums.length;j++){\n               if(target-a==nums[j]){\n                   ret[0]=i;\n                   ret[1]=j;\n                   flag=true;\n                   break;\n               }\n            }\n            if(flag)\n               break;\n        }\n        return ret;\n    }\n}','','TwoSum','Given an array of integers, return indices of the two numbers such that they add up to a specific target.\n\nYou may assume that each input would have exactly one solution, and you may not use the same element twice.\n\n**Example**\n```\nGiven nums = [2, 7, 11, 15], target = 9,\n\nBecause nums[0] + nums[1] = 2 + 7 = 9,\nreturn [0, 1].\n```','给定一个数组和一个值，求数组中两个值，使得之和为给定值',NULL,'004',1,'main',1,'测试',25,'public class TwoSum {\r\n    public int[] main(int[] nums,int target) {\r\n      //do something;\r\n    }\r\n}','leetcode-两数之和',26,'402881925c3fa5c4015c3fef43da0000','leetcode',NULL,NULL),('402881925c4986bd015c499d23ad0007','2017-05-27 19:14:14',0,'2017-05-28 09:08:02',18,'import java.util.HashMap;\nimport java.util.Map;\n\n/**\n * Created by billJiang on 2017/5/27.\n * e-mail:475572229@qq.com  qq:475572229\n */\npublic class Solution005 {\n    public int lengthOfLongestSubstring(String s) {\n        Map<Character, Integer> map = new HashMap<>();\n        int max = 0;\n        int start = 0;\n        for (int i = 0; i < s.length(); i++) {\n            if (map.containsKey(s.charAt(i))) {\n                start=Math.max(map.get(s.charAt(i))+1,start);\n                if (i - start+1 > max) {\n                    max = i - start+1;\n                }\n\n            }else{\n                if(i-start+1>max)\n                    max=i-start+1;\n            }\n\n            map.put(s.charAt(i), i);\n        }\n        return max;\n    }\n}','','Solution005','Given a string, find the length of the longest substring without repeating characters.\n\n**Examples:**\n\nGiven `\"abcabcbb\"`, the answer is `\"abc\"`, which the length is 3.\n\nGiven `\"bbbbb\"`, the answer is `\"b\"`, with the length of 1.\n\nGiven `\"pwwkew\"`, the answer is `\"wke\"`, with the length of 3.\nNote that the answer must be a substring,` \"pwke\"` is a subsequence and not a substring.\n\n','给定一串字符串，求最大长度的不重复的子字符串长度',NULL,'005',3,'lengthOfLongestSubstring',1,'测试',1,'public class Solution005 {\r\n        public int lengthOfLongestSubstring(String s){\r\n      //do something;\r\n    }\r\n}','最大不重复子串',6,'','leetCode',NULL,NULL),('8a8a82575c32a64a015c32cd899d0000','2017-05-23 08:55:49',0,'2017-05-23 08:55:49',6,'public class Solution {\r\n    public int method(int[] nums) {\r\n      //do something;\r\n    }\r\n}','','Solution','\n####问题描述\n\n一种双核CPU的两个核能够同时的处理任务，现在有n个已知数据量的任务需要交给CPU处理，假设已知CPU的每个核1秒可以处理1kb，每个核同时只能处理一项任务。n个任务可以按照任意顺序放入CPU进行处理，现在需要设计一个方案让CPU处理完这批任务所需的时间最少，求这个最小的时间。\n\n####输入描述\n```\n输入包括两行：\n第一行为整数n(1 ≤ n ≤ 50)\n第二行为n个整数length[i](1024 ≤ length[i] ≤ 4194304)，表示每个任务的长度为length[i]kb，每个数均为1024的倍数\n```\n\n####输出描述\n```\n输出一个整数，表示最少需要处理的时间\n```\n\n####输入示例\n\n```\n5\n3072 3072 7168 3072 1024\n```\n\n####输出示例\n```\n9216\n```','一种双核CPU的两个核能够同时的处理任务，现在需要设计一个方案让CPU处理完这批任务所需的时间最少',NULL,'001',3,'method',0,'测试',0,'public class Solution {\r\n    public int method(int[] nums) {\r\n      //do something;\r\n    }\r\n}','双核处理问题',6,'','',NULL,NULL),('8a8a82575c3cfb3d015c3d32c6220003','2017-05-25 09:22:36',0,'2017-05-25 16:34:26',42,'public class MaxNumber {\r\n    public int getMax(int[] numArr) {\r\n       int max=numArr[0];\r\n       for(int i=1;i<numArr.length;i++){\r\n           if(max<numArr[i]){\r\n               max=numArr[i];\r\n           }\r\n       }\r\n       return max;\r\n    }\r\n}','','MaxNumber','**问题描述**\n\n设计一个算法，找出一个整数数组中的最大值\n\n**输入描述**\n```\n一维整数数组\n```\n**输出描述**\n```\n最大值\n```\n**输入示例**\n```\n[1,3,4,6,2,100,5]\n```\n**输出示例**\n```\n100\n```','设计一个算法，找出一个整数数组中的最大值',NULL,'003',1,'getMax',10,'测试',53,'public class MaxNumber {\r\n    public int getMax(int[] numArr) {\r\n      //wirte your code\r\n    }\r\n}','数组最大值',66,'8a8a82575c3cfb3d015c3d3127d50002','',NULL,NULL);
