INSERT INTO `tbl_item_output` VALUES ('8a8a82695c5c23f5015c5c577c9c0000','2017-05-31 10:30:56',0,'2017-05-31 14:30:34',2,'Solution008OutputResolver','402880e55c597d0c015c59a856730000','resolve','import java.util.List;\r\nimport java.util.ArrayList;\r\nimport java.util.Arrays;\r\npublic class Solution008OutputResolver {\r\n    public String resolve(ListNode param) {\r\n        //write your code here;\r\n        List<Integer> list=new ArrayList<Integer>();\r\n        list.add(param.val);\r\n        while(param.next!=null){\r\n            param=param.next;\r\n            list.add(param.val);\r\n        }\r\n        return Arrays.toString(list.toArray());\r\n    }\r\n}\r\n\r\n\r\n/*public class ListNode {\r\n     int val;\r\n     ListNode next;\r\n     ListNode(int x) { val = x; }\r\n}*/','ListNode','0');
