INSERT INTO `tbl_markdown` VALUES ('402880e958ecdff60158ed0c62ba0001','2016-12-11 16:42:41',0,'2017-02-06 11:18:28',2,'Markdown,关键字','欢迎使用Markdown编辑器写文章',NULL,'# 欢迎使用Markdown编辑器写文章\n\n本Markdown编辑器使用**Editor.md**修改而来，用它写技术文章，将会带来全新的体验哦：\n\n- **Markdown和扩展Markdown简洁的语法**\n- **代码块高亮**\n- **图片链接和图片上传**\n- ***LaTex*数学公式**\n- **UML序列图和流程图**\n- **离线写文章**\n- **导入导出Markdown文件**\n- **丰富的快捷键**\n-------------------\n\n## 快捷键\n\n - 加粗     `Ctrl + B`\n - 斜体     `Ctrl + I`\n - 引用     `Ctrl + Q`\n - 插入链接    `Ctrl + L`\n - 插入代码    `Ctrl + K`\n - 插入图片    `Ctrl + G`\n - 提升标题    `Ctrl + H`\n - 有序列表    `Ctrl + O`\n - 无序列表    `Ctrl + U`\n - 横线    `Ctrl + R`\n - 撤销    `Ctrl + Z`\n - 重做    `Ctrl + Y`\n\n## Markdown及扩展\n\n> Markdown 是一种轻量级标记语言，它允许人们使用易读易写的纯文本格式编写文档，然后转换成格式丰富的HTML页面。    —— <a href=\"https://zh.wikipedia.org/wiki/Markdown\" target=\"_blank\"> [ 维基百科 ]\n\n使用简单的符号标识不同的标题，将某些文字标记为**粗体**或者*斜体*，创建一个[链接](http://www.csdn.net)等，详细语法参考帮助？。\n\n本编辑器支持 **Markdown Extra** , 　扩展了很多好用的功能。具体请参考[Github][2].\n\n### 表格\n\n**Markdown　Extra**　表格语法：\n\n项目     | 价格\n-------- | ---\nComputer | $1600\nPhone    | $12\nPipe     | $1\n\n可以使用冒号来定义对齐方式：\n\n| 项目      |    价格 | 数量  |\n| :-------- | --------:| :--: |\n| Computer  | 1600 元 |  5   |\n| Phone     |   12 元 |  12  |\n| Pipe      |    1 元 | 234  |\n\n\n### 代码块\n代码块语法遵循标准markdown代码，例如：\n``` python\n@requires_authorization\ndef somefunc(param1=\'\', param2=0):\n    \'\'\'A docstring\'\'\'\n    if param1 > param2: # interesting\n        print \'Greater\'\n    return (param2 - param1 + 1) or None\nclass SomeClass:\n    pass\n>>> message = \'\'\'interpreter\n... prompt\'\'\'\n```\n\n\n### 目录\n用 `[TOC]`来生成目录：\n\n[TOC]\n\n### 数学公式\n使用MathJax渲染*LaTex* 数学公式，详见[math.stackexchange.com][1].\n\n - 行内公式，数学公式为：$\\Gamma(n) = (n-1)!\\quad\\forall n\\in\\mathbb N$。\n - 块级公式：\n\n$$	x = \\dfrac{-b \\pm \\sqrt{b^2 - 4ac}}{2a} $$\n\n更多LaTex语法请参考 [这儿][3].\n\n### UML 图:\n\n可以渲染序列图：\n\n```sequence\n张三->李四: 嘿，小四儿, 写博客了没?\nNote right of 李四: 李四愣了一下，说：\n李四-->张三: 忙得吐血，哪有时间写。\n```\n\n或者流程图：\n\n```flow\nst=>start: 开始\ne=>end: 结束\nop=>operation: 我的操作\ncond=>condition: 确认？\n\nst->op->cond\ncond(yes)->e\ncond(no)->op\n```\n\n- 关于 **序列图** 语法，参考 [这儿][4],\n- 关于 **流程图** 语法，参考 [这儿][5].\n\n## 离线写博客\n\n即使用户在没有网络的情况下，也可以通过本编辑器离线写文章（直接在曾经使用过的浏览器中输入[write.blog.csdn.net/mdeditor](http://write.blog.csdn.net/mdeditor)即可。**Markdown编辑器**使用浏览器离线存储将内容保存在本地。\n\n用户写文章的过程中，内容实时保存在浏览器缓存中，在用户关闭浏览器或者其它异常情况下，内容不会丢失。用户再次打开浏览器时，会显示上次用户正在编辑的没有发表的内容。\n\n文章发表后，本地缓存将被删除。\n\n用户可以选择 <i class=\"icon-disk\"></i> 把正在写的文章保存到服务器草稿箱，即使换浏览器或者清除缓存，内容也不会丢失。\n\n> **注意：**虽然浏览器存储大部分时候都比较可靠，但为了您的数据安全，在联网后，**请务必及时发表或者保存到服务器草稿箱**',NULL,NULL,NULL,NULL,NULL),('402880ea5aae3edf015ab22e20740018','2017-03-09 16:27:31',0,'2017-03-09 17:29:53',2,'BaseFile,Bootstrap-fileinput,附件上传','附件上传组件BaseFile使用说明','402880e456223e8f015625231d8e0003','##介绍\nBaseFile是AdminEAP框架中基于Bootstrap-fileinput的附件上传组件，它支持 支持多文件、在线预览、拖拽上传等功能，封装后BaseFile主要包括以下功能：\n\n- 弹出窗口的附件上传\n- 当前界面的附件上传\n- 显示附件明细\n- 可编辑的附件明细（删除、预览、不可新增）\n\n关于BaseFile的详细使用，请参照本人博客：[Bootstrap-fileinput组件封装及使用 ](blog.csdn.net/jrn1012/article/details/60963714)\n关于Bootstrap-fileinput的API文档可参考[http://plugins.krajee.com/file-input](http://plugins.krajee.com/file-input)\n\n##使用说明\n###1、初始化\n如果需要在当前界面使用附件上传功能（非弹窗方式）则需要在头部引入相关的css和js文件\n- css文件\n```\n<link rel=\"stylesheet\" href=\"./resources/common/libs/fileinput/css/fileinput.min.css\">\n```\n- js文件\n```\n<script src=\"./resources/common/libs/fileinput/js/fileinput.js\"></script>\n<script src=\"./resources/common/libs/fileinput/js/locales/zh.js\"></script>\n<!--BaseFile组件-->\n<script src=\"./resources/common/js/base-file.js\"></script>\n```\nform表单上还需要配置`enctype=\"multipart/form-data\"`属性\n\n###2、弹窗方式调用\n\nBaseFile支持弹窗方式打开一个附件上传窗口，点击附件上传后，弹出窗口，上传附件关闭窗口后，上传的附件在type=file的控件回填，配置如下：\n- html代码\n```\n          <input type=\"hidden\" name=\"fileIds\" id=\"fileIds\">\n          <div class=\"form-group\">\n                <div class=\"btn btn-default btn-file\" id=\"uploadFile\">\n                    <i class=\"fa fa-paperclip\"></i> 上传附件(Max. 10MB)\n                </div>\n            </div>\n            <div class=\"form-group\" id=\"file_container\">\n                <input type=\"file\" name=\"file\"  id=\"attachment\">\n            </div>    \n```\n- js代码\n```javascript\n$(\"#uploadFile\").file({\n            title: \"请上传附件\",\n            fileinput: {\n                maxFileSize: 10240,\n                maxFileCount:3\n            },\n            fileIdContainer:\"[name=\'fileIds\']\",\n            showContainer:\'#attachment\',\n            //显示文件类型 edit=可编辑  detail=明细 默认为明细\n            showType:\'edit\',\n            //弹出窗口 执行上传附件后的回调函数(window:false不调用此方法)\n			window:true,\n            callback:function(fileIds,oldfileIds){\n                //更新fileIds\n                this.showFiles({\n                    fileIds:fileIds\n                });\n            }\n        });\n```\n###3、本地界面调用\n本地界面调用附件上传，通过以下方式配置：\n\n- html代码\n```html\n<div class=\"form-group\" id=\"file_container\">\n      <input type=\"file\" name=\"file\"  id=\"attachment\">\n</div>\n```\n- js代码\n```javascript\n    $(\"#attachment\").file({\n            fileinput: {\n                maxFileSize: 10240,\n                maxFileCount:3\n            },\n            fileIdContainer:\"[name=\'fileIds\']\",\n            window:false\n        });\n```\n###4、参数说明\n- `window` 默认为true,弹窗方式打开\n\n- `title` window=true时配置，弹窗的标题，默认为“文件上传”\n\n- `width` window=true时配置，弹窗的宽度，默认900\n\n- `winId` window=true时配置，弹出的id，默认为fileWin\n\n- `fileinput` Bootstrap-fileinput的配置参数，会覆盖默认配置，比如允许上传哪种类型的附件`allowedFileTypes`，允许上传最大附件大小`maxFileSize`，允许上传附件的个数`maxFileCount`等，具体的配置参数可以查询Bootstrap-fileinput的API文档。\n\n- `fileIdContainer` 必须，上传后的附件id存储的位置，id以逗号分隔\n\n- `showContainer` window=true必须配置，文件上传后回填的区域，window=false时如不配置，则取base-file的初始对象\n\n- `showType` window=true配置，值为`edit`或者`detail`,`edit`表示回填后可对数据进行删除、预览，`detail`只能显示，不能删除\n\n- `callback` window=true配置，关闭附件上传的窗口后执行的回调函数（比如更新当前的文件列表），`fileIds`,`oldfileIds`两个参数分别是更新后文件ids和更新前的文件ids\n\n- BaseFile默认配置，BaseFile的更多实现，请查看BaseFile源码\n```javascript\nBaseFile.prototype.default = {\n        winId: \"fileWin\",\n        width: 900,\n        title: \"文件上传\",\n        //通用文件上传界面\n        url: basePath + \"/file/uploader\",\n        //默认支持多文件上传\n        multiple: true,\n        //默认弹出附件上传窗口\n        window:true,\n        showType:\"detail\",\n        fileinput: {\n            language: \'zh\',\n            uploadUrl: basePath + \"/file/uploadMultipleFile\",\n            deleteUrl:basePath+\"/file/delete\",\n            uploadAsync:false,\n            validateInitialCount:true,\n            overwriteInitial: false,\n            allowedPreviewTypes: [\'image\'],\n            previewFileIcon:\'<i class=\"fa fa-file-o\"></i>\',\n            previewFileIconSettings: null,\n            slugCallback: function (text) {\n                var newtext=(!text||text==\'\') ? \'\' : String(text).replace(/[\\-\\[\\]\\/\\{}:;#%=\\(\\)\\*\\+\\?\\\\\\^\\$\\|<>&\"\']/g, \'_\');\n                //去除空格\n                return newtext.replace(/(^\\s+)|(\\s+$)/g,\"\").replace(/\\s/g,\"\");\n            }\n        }\n    }\n```\n\n','file',NULL,NULL,NULL,NULL),('402880ed5abdfec1015abe20b0e90000','2017-03-12 00:08:17',0,'2017-03-12 00:08:17',0,'BaseFile,Bootstrap-fileinput,附件上传,附件下载','附件上传组件BaseFile使用说明-附件下载实现','402880e456223e8f015625231d8e0003','##介绍\n在上一篇文章中介绍了Bootstrap-fileinput组件的封装及使用，这篇文章延续上一篇文章，介绍了基于封装后的组件BaseFile中下载功能实现，也就是Bootstrap-fileinput中otherActionButtons中扩展自定义按钮。如下图所示：\n\n![下载按钮](http://img.blog.csdn.net/20170311234606744?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n##实现步骤\n\n###1、修改fileinput.js源码\n（fileinput.min.js也要相应修改），修改此处是为了在文件尚未上传时，下载按钮不显示，如下图所示：\n![fileinput.js代码修改](http://img.blog.csdn.net/20170311235027047?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n###2、配置下载按钮\n在BaseFile文件中，配置下载otherActionButtons属性。\n![下载按钮配置](http://img.blog.csdn.net/20170311235325208?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n```\notherActionButtons:\'<button type=\"button\" class=\"kv-file-down btn btn-xs btn-default\" {dataKey} title=\"下载附件\"><i class=\"fa fa-cloud-download\"></i></button>\',\n```\n###3、下载按钮事件绑定\n在文件显示、上传文件成功，批量上传文件成功后绑定下载事件，每次把先解绑click事件后在绑定，防止重复绑定。\n![绑定下载事件](http://img.blog.csdn.net/20170311235701260?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n相关代码：\n\n```javascript\n   BaseFile.prototype.showFiles=function(options){\n        //此处省略一大堆代码\n        //console.log(\"config==========\"+JSON.stringify(config));\n        fileComponet.fileinput(\'destroy\');\n        fileComponet.fileinput(config).on(\"filedeleted\",function (event,key) {\n            var newfids=self.deleteFileIds(key,self.options.fileIds);\n            self.options.fileIds=newfids;\n            self.updateFileIds();\n        }).on(\"fileuploaded\",function(event,data,previewId,index){\n            var newfids=self.addFileIds(data.response.fileIds,self.options.fileIds);\n            self.options.fileIds=newfids;\n            self.updateFileIds();\n            //otherActionButtons绑定事件 下载按钮绑定\n            self.downloadHandler(this);\n        }).on(\"filebatchuploadsuccess\",function (event,data,previewId,index) {\n            var newfids=self.addFileIds(data.response.fileIds,self.options.fileIds);\n            self.options.fileIds=newfids;\n            self.updateFileIds();\n            //otherActionButtons绑定事件\n            self.downloadHandler(this);\n        }).on(\"filezoomhidden\", function(event, params) {\n            $(document.body).removeClass(\'modal-open\');\n            $(document.body).css(\"padding-right\",\"0px\");\n        })\n        this.downloadHandler(fileComponet);\n    }\n\n\n    /**\n     * 其他按钮（如下载）绑定时间\n     */\n    BaseFile.prototype.downloadHandler=function(fileobj){\n        if(!fileobj)\n            fileobj=$(this.options.showContainer);\n        var objs=$(fileobj).data(\'fileinput\').$preview.find(\".kv-preview-thumb .kv-file-down\");\n        objs.unbind(\"click\");\n        objs.on(\"click\",function(){\n           //点击下载\n            window.location.href=basePath+\"/file/download/\"+$(this).data(\"key\");\n        });\n    }\n```\n弹出窗口方式上传文件绑定下载事件类似，可在file_uploader.html中找到相关代码。\n\n###4、后台下载文件方法\n\n```java\n  @RequestMapping(value=\"/download/{id}\",method = RequestMethod.GET)\n    public void downloadFile(@PathVariable(\"id\") String id,HttpServletRequest request,HttpServletResponse response) throws IOException {\n        SysFile sysfile = uploaderService.get(SysFile.class, id);\n\n        InputStream is = null;\n        OutputStream os = null;\n        File file = null;\n        try {\n            // PrintWriter out = response.getWriter();\n            if (sysfile != null)\n                file = new File(request.getRealPath(\"/\")+sysfile.getFilePath());\n            if (file != null && file.exists() && file.isFile()) {\n                long filelength = file.length();\n                is = new FileInputStream(file);\n                // 设置输出的格式\n                os = response.getOutputStream();\n                response.setContentType(\"application/x-msdownload\");\n                response.setContentLength((int) filelength);\n                response.addHeader(\"Content-Disposition\", \"attachment; filename=\\\"\" + new String(sysfile.getFileName().getBytes(\"GBK\"),// 只有GBK才可以\n                        \"iso8859-1\") + \"\\\"\");\n\n                // 循环取出流中的数据\n                byte[] b = new byte[4096];\n                int len;\n                while ((len = is.read(b)) > 0) {\n                    os.write(b, 0, len);\n                }\n            } else {\n                response.getWriter().println(\"<script>\");\n                response.getWriter().println(\" modals.info(\'文件不存在!\');\");\n                response.getWriter().println(\"</script>\");\n            }\n\n        } catch (IOException e) {\n            // e.printStackTrace();\n        } finally {\n            if (is != null) {\n                is.close();\n            }\n            if (os != null) {\n                os.close();\n            }\n        }\n    }\n```\n\n',NULL,NULL,NULL,NULL,NULL),('402881935a5f60d3015a5f7d43900000','2017-02-21 15:05:29',0,'2017-02-21 15:08:45',1,'代码生成器,AdminEAP,AdminLTE,freemarker','代码生成器的使用说明','402880e456223e8f015625231d8e0003','AdminEAP为是基于AdminLTE改造的后台管理框架，包含了组件集成、CURD增删改查、系统工具、工作流、系统权限与安全等基本的系统管理功能和各种交互demo，项目源码已经在Github上开源，并部署到阿里云。\n\n**Github** : https://github.com/bill1012/AdminEAP\n\n**AdminEAP 官网**: http://www.admineap.com\n\n本文介绍使用freemarker模板，在AdminEAP框架下实现代码生成器，以实现CURD功能的快速生成，借助于代码生成器，基础的开发可以节约大量的时间，同时保持了编码的一致性。\n\n![这里写图片描述](http://img.blog.csdn.net/20170221133333679?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n#使用步骤\n\n下面以Generator实体为例，介绍代码生成器的使用\n\n##1、编写实体类\n\n编写实体类，通过自定义注解Header声明相关属性\n\n![编写实体类](http://img.blog.csdn.net/20170221142700625?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\nHeader为自定义注解，开发者在建立外键关系时，可通过ManyToOne，也通过joinClass指定关联的实体，dataSource指定了在编辑时，该属性的数据来源，当为字典时，指定为字典父编码，也可以指定一个url。\n\n##2、生成xml配置\n\n启动项目后，输入queryId，实体名，业务名，点击“加载配置“，弹出xml配置窗口，可在此配置窗口配置查询xml\n\n![生成xml](http://img.blog.csdn.net/20170221144007125?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\nAdminEAP的所有数据列表都是基于xml配置的，可支持反射接口查询、sql配置的查询、离线查询（hql）。\n\n##3、重启系统使xml配置生效\n\n如果是首次生成xml文件（注意是文件，如果在已有的xml配置内容，则不需要重新，刷新系统即可，系统会读取更新的xml）\n\n![配置xml](http://img.blog.csdn.net/20170221144603370?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n##4、配置具体参数\n\n输入queryId，点击”加载配置“后，系统读取xml的配置，并回填所有的默认配置，包括要生成的文件，文件路径等等，开发者也可以根据自己的需要更改参数配置。在界面右侧是实体的属性列表，开发者可以勾选数据再编辑时使用的控件类型，也可以勾选是是否作为查询条件，是否在编辑界面中维护等等。\n\n![配置具体参数](http://img.blog.csdn.net/20170221145011918?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n更具体配置说明，包含在今后的技术文档（付费）中\n\n##5、根据freemarker模板生成代码\n\n从界面上收集好以上配置参数后，代码生成器将这些参数给配置好的freemarker模板，生成相关的源代码。\n\n以下是控制器模板controller.html\n```\npackage ${nameSpace}.controller;\n\nimport java.util.Date;\n\nimport javax.annotation.Resource;\nimport javax.servlet.http.HttpServletRequest;\n\nimport com.alibaba.fastjson.JSON;\nimport com.cnpc.framework.base.entity.Dict;\nimport com.cnpc.framework.utils.StrUtil;\nimport org.springframework.beans.BeanUtils;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.web.bind.annotation.PathVariable;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.RequestMethod;\nimport org.springframework.web.bind.annotation.ResponseBody;\n\nimport com.cnpc.framework.base.service.BaseService;\nimport com.cnpc.framework.annotation.RefreshCSRFToken;\nimport com.cnpc.framework.annotation.VerifyCSRFToken;\nimport com.cnpc.framework.base.pojo.Result;\nimport ${className};\n\n/**\n* ${modelName}管理控制器\n* @author jrn\n* ${curTime?string(\"yyyy-MM-dd HH:mm:ss\")}由代码生成器自动生成\n*/\n@Controller\n@RequestMapping(\"/${htmlPrefix}\")\npublic class ${javaPrefix}Controller {\n\n    @Resource\n    <#if javaTypes?contains(\"service\")>\n    private ${javaPrefix}Service ${htmlPrefix}Service;\n    <#else>\n    private BaseService baseService;\n    </#if>\n\n    @RequestMapping(value=\"/list\",method = RequestMethod.GET)\n    public String list(){\n        return \"${businessPackage}/${htmlPrefix}_list\";\n    }\n\n    @RefreshCSRFToken\n    @RequestMapping(value=\"/edit\",method = RequestMethod.GET)\n    public String edit(String id,HttpServletRequest request){\n        request.setAttribute(\"id\", id);\n        return \"${businessPackage}/${htmlPrefix}_edit\";\n    }\n\n    @RequestMapping(value=\"/detail\",method = RequestMethod.GET)\n    public String detail(String id,HttpServletRequest request){\n        request.setAttribute(\"id\", id);\n        return \"${businessPackage}/${htmlPrefix}_detail\";\n    }\n\n    @RequestMapping(value=\"/get/{id}\",method = RequestMethod.POST)\n    @ResponseBody\n    public ${javaPrefix} get(@PathVariable(\"id\") String id){\n        return <#if javaTypes?contains(\"service\")>${htmlPrefix}Service<#else>baseService</#if>.get(${javaPrefix}.class, id);\n    }\n\n    @VerifyCSRFToken\n    @RequestMapping(value=\"/save\")\n    @ResponseBody\n    <#assign isObj=1>\n    <#list fields as field>\n        <#if field.columnName?contains(\".\")>\n            <#assign isObj=0>\n        </#if>\n    </#list>\n    public Result save(<#if isObj=1>${javaPrefix} ${htmlPrefix}<#else>String obj</#if>){\n        <#if isObj=0>\n        ${javaPrefix} ${htmlPrefix}= JSON.parseObject(obj,${javaPrefix}.class);\n        <#list fields as field>\n        <#if field.columnName?contains(\".\")>\n            <#assign fieldName=field.columnName?substring(0,field.columnName?index_of(\".\"))>\n            <#assign fieldN=fieldName?substring(0,1)?upper_case+fieldName?substring(1)>\n        ${htmlPrefix}.set${fieldN}(<#if javaTypes?contains(\"service\")>${htmlPrefix}Service<#else>baseService</#if>.get(${field.type}.class,${htmlPrefix}.get${fieldN}().getId()));\n        </#if>\n        </#list>\n        </#if>\n        if(StrUtil.isEmpty(${htmlPrefix}.getId())){\n        <#if dateFields?exists&&(dateFields?size>0)>\n            <#list dateFields as date>\n            ${date};\n            </#list>\n        </#if>\n            <#if javaTypes?contains(\"service\")>${htmlPrefix}Service<#else>baseService</#if>.save(${htmlPrefix});\n        }\n        else{\n        <#if leftFields?exists&&(leftFields?size>0)>\n            ${javaPrefix} ${htmlPrefix}_old=<#if javaTypes?contains(\"service\")>${htmlPrefix}Service<#else>baseService</#if>.get(${javaPrefix}.class,${htmlPrefix}.getId());\n            BeanUtils.copyProperties(${htmlPrefix},${htmlPrefix}_old, <#list leftFields as str><#if str_index==0>\"${str}\"<#else>,\"${str}\"</#if></#list>);\n            <#if leftDates?exists&&(leftDates?size>0)>\n                <#list leftDates as ld>\n             ${ld};\n                </#list>\n            </#if>\n            ${htmlPrefix}_old.setUpdateDateTime(new Date());\n            <#if javaTypes?contains(\"service\")>${htmlPrefix}Service<#else>baseService</#if>.update(${htmlPrefix}_old);\n            <#else>\n            ${htmlPrefix}.setUpdateDateTime(new Date());\n            <#if javaTypes?contains(\"service\")>${htmlPrefix}Service<#else>baseService</#if>.update(${htmlPrefix});\n            </#if>\n        }\n        return new Result(true);\n    }\n    \n    @RequestMapping(value=\"/delete/{id}\",method = RequestMethod.POST)\n    @ResponseBody\n    public Result delete(@PathVariable(\"id\") String id){\n        ${javaPrefix} ${htmlPrefix}=this.get(id);\n        try{\n            baseService.delete(${htmlPrefix});\n            return new Result();\n        }\n        catch(Exception e){\n            return new Result(false,\"该数据已经被引用，不可删除\");\n        }\n    }\n\n}\n\n```\n\n##6、修改生成的代码并重启系统查看效果\n\n开发者根据需要修改生成的代码，并重启系统，查看效果，如果需要分配权限，请先将生成的菜单功能授权，才可有相应的菜单。\n\n![代码生成器-列表](http://img.blog.csdn.net/20170221145826165?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n![代码生成-编辑](http://img.blog.csdn.net/20170221145859391?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n通过代码生成生成了一个业务功能的CURD操作。\n\n##7、总结\n\n以上操作步骤，在开发环境使用，在项目中使用代码生成器的主要工作量在编写实体，两次重启系统（如果在之前xml追加内容，则是一次重启）上，其余采用默认配置即可。\n\n欢迎大家使用AdminEAP框架，如有意见建议请登录[AdminEAP官网](http://www.admineap.com)给我提意见。\n\n\n','code',NULL,NULL,NULL,NULL),('8a8a81425a118296015a118d0fda0000','2017-02-06 11:52:21',0,'2017-05-24 10:23:51',4,'Bootstrap modal,模态窗体','模态窗体Modals使用说明','402880e456223e8f015625231d8e0003','##功能说明\n在AdminEAP框架中，封装了Bootstrap modal窗体，提供以下功能\n- info(提示)\n- correct(成功)\n- warn(警告)\n- error(错误)\n- confirm(确认)\n- popup(提示，无按钮)\n- openWin(模态窗体)\n\n##使用示例\n引入文件\n`<script type=\"text/javascript\" src=\"${basePath}/resources/common/js/base-modal.js\"></script>`\n###1.提示\n<div style=\"padding-bottom:20px;\">\n<button class=\'btn btn-info\' data-btn-type=\'info\' onclick=\'modals.info(\"提示信息\")\'>提示</button>\n</div>\n\n```\n<button class=\'btn btn-info\' data-btn-type=\'info\' onclick=\'info()\'>提示</button>\n\n<script>\n  function info(){\n     modals.info(\'提示信息\');\n  }\n</script>\n```\n###2.成功\n<div style=\"padding-bottom:20px;\">\n<button class=\'btn btn-success\' data-btn-type=\'success\' onclick=\'modals.correct(\"操作成功信息\")\'>成功</button>\n</div>\n\n```\n<button class=\'btn btn-success\' data-btn-type=\'success\' onclick=\'correct()\'>成功</button>\n\n<script>\n  function correct(){\n     modals.correct(\'操作成功信息\');\n  }\n</script>\n```\n###3.警告\n<div style=\"padding-bottom:20px;\">\n<button class=\'btn btn-warning\' data-btn-type=\'warn\' onclick=\'modals.warn(\"警告信息\")\'>警告</button>\n</div>\n\n```\n<button class=\'btn btn-warning\' data-btn-type=\'warn\' onclick=\'warn()\'>警告</button>\n\n<script>\n  function warn(){\n     modals.warn(\'警告信息\');\n  }\n</script>\n```\n###4.错误\n<div style=\"padding-bottom:20px;\">\n<button class=\'btn btn-danger\' data-btn-type=\'error\' onclick=\'modals.error(\"错误提示信息\")\'>错误</button>\n</div>\n\n```\n<button class=\'btn btn-danger\' data-btn-type=\'error\' onclick=\'error()\'>错误</button>\n\n<script>\n  function error(){\n     modals.error(\'错误提示信息\');\n  }\n</script>\n```\n###5.确认提示框\n<div style=\"padding-bottom:20px;\">\n<button class=\'btn btn-primary\' data-btn-type=\'confirm\' onclick=\'modals.confirm(\"错误提示信息\",function(){alert(\"do something\")})\'>确认提示框</button>\n</div>\n\n```\n<button class=\'btn btn-primary\' data-btn-type=\'confirm\' onclick=\'confirm()\'>确认提示框</button>\n\n<script>\n  function confirm(){\n     modals.confirm(\'错误提示信息\'，function(){\n	    alert(\'do something\');\n	 });\n  }\n</script>\n```\n\"取消\"按钮带回调函数的调用方法\n```javascript\n modals.confirm({\n                text:\"是否为选择的\"+userArr.length+\"个用户建立群组？\",\n                callback:function () {\n                    openGroupAddWin();\n                    modals.hideWin(\"receiverWin\");\n                },\n                cancel_call:function () {\n                    setReceiverUserIds();\n                    modals.hideWin(\"receiverWin\");\n                }\n        })\n```\n###6.自定义模态窗口\n<div style=\"padding-bottom:20px;\">\n<button class=\'btn btn-info\' data-btn-type=\'window\' onclick=\'modals.openWin({winId:\"userWin\", title:\"新增用户\", width:\"900px\", url:basePath+\"/user/edit\"})\'>自定义模态窗口</button>\n</div>\n\n```\n<button class=\'btn btn-info\' data-btn-type=\'window\' onclick=\'openWin()\'>自定义模态窗口</button>\n\n<script>\n  function openWin(){\n     modals.openWin({\n	    winId:\'userWin\',\n        title:\'新增用户\',\n        width:\'900px\',\n        url:basePath+\"/user/edit\"\n	 });\n  }\n</script>\n```\n\n <button class=\"btn btn-primary\" id=\"btn_msg\" style=\"width: 100%\" onclick=\'modals.openWin({ \n                winId:\"messageWin\",\n                title:\"给【billJiang】留言\",\n                width:\"750px\",\n                url:basePath+\"/message/mail/edit\"\n            });\'><i class=\"fa fa-commenting\"></i>&nbsp;&nbsp;我是billJiang，如果有任何意见/建议/创意/问题/想法，点击该按钮给我留言</button>\n','modal',NULL,NULL,NULL,NULL),('8a8a826c5ac5e9a4015ac65cc9630000','2017-03-13 14:30:54',0,'2017-03-13 15:03:48',1,'CSRF,AdminEAP','AdminEAP框架防范CSRF','402880e456223e8f015625231d8e0003','##介绍\n\nCSRF（Cross-site request forgery跨站请求伪造，也被称为“One Click Attack”或者Session Riding，通常缩写为CSRF或者XSRF，是一种对网站的恶意利用。尽管听起来像跨站脚本（XSS），但它与XSS非常不同，并且攻击方式几乎相左。XSS利用站点内的信任用户，而CSRF则通过伪装来自受信任用户的请求来利用受信任的网站。与XSS攻击相比，CSRF攻击往往不大流行（因此对其进行防范的资源也相当稀少）和难以防范，所以被认为比XSS更具危险性。\n\n本文介绍在AdminEAP框架下，如何防范CSRF。\n\n##思路\n\n具体思路：\n\n1、跳转页面前生成随机token，并存放在session中\n\n2、form中将token放在隐藏域中，保存时将token放头部一起提交\n\n3、获取头部token，与session中的token比较，一致则通过，否则不予提交\n\n4、生成新的token，并传给前端\n\n##实现\n1、Spring MVC中配置拦截器：\n```xml\n<mvc:interceptors>\n	    <!-- csrf攻击防御 -->\n		<mvc:interceptor>\n			<!-- 需拦截的地址 -->\n			<mvc:mapping path=\"/**\" />\n			<!-- 需排除拦截的地址 -->\n			<mvc:exclude-mapping path=\"/resources/**\" />\n			<mvc:exclude-mapping path=\"/uploadPath/**\" />\n			<!-- <mvc:exclude-mapping path=\"/user/user_login\" />\n			<mvc:exclude-mapping path=\"/user/login\" /> -->\n			<bean class=\"com.cnpc.framework.interceptor.CSRFInterceptor\" />\n		</mvc:interceptor>\n	</mvc:interceptors>\n```\n2、拦截器的具体实现：(具体实现代码详见CSRFInterceptor.java)\n\n1）进入方法之前，校验CSRF，校验失败，刷新csrftoken，向前端抛出错误信息\n>在preHandler方法上读取verifyCSRFToken注解配置，如果未配置直接通过验证，如果配置了，为GET页面跳转请求（不含@ResponseBody）则刷新session中的csrftoken,并向前端弹出错误信息。如果为ajax请求，刷新session中csrftoken，并将新的csrftoken写入responseBody,并在前端$.ajax方法中success方法中进行处理和提示(在success处理token不一致)\n\n```javascript\n$.ajax({\n		type : \'post\',\n		async : false,\n		url : url,\n		data : params,\n		dataType : \'json\',\n		headers:headers,\n		success : function(data, status) {\n			result = data;\n			if(data&&data.code&&data.code==\'101\'){\n				modals.error(\"操作失败，请刷新重试，具体错误：\"+data.message);\n				return false;\n			}\n			if (callback) { \n				callback.call(this, data, status);\n			}\n		},\n		error : function(err, err1, err2) {\n			console.log(err.responseText);\n		    if(err && err.readyState && err.readyState == \'4\'){\n                var responseBody = err.responseText;\n                if(responseBody){   \n                	 responseBody = \"{\'retData\':\"+responseBody;\n                     var resJson = eval(\'(\' + responseBody + \')\');\n                     $(\"#csrftoken\").val(resJson.csrf.CSRFToken);\n                     this.success(resJson.retData, 200);\n                }\n                return ;\n            } 		    \n			modals.error({\n				text : JSON.stringify(err) + \'<br/>err1:\' + JSON.stringify(err1) + \'<br/>err2:\' + JSON.stringify(err2),\n				large : true\n			});\n		}\n	});\n```\n2）校验CSRF成功后，在postHandler中刷新csrftoken\n>读取RefreshCSRFToken注解，如果配置了该注解刷新session中的csrftoken，如果配置了VerifyCSRFToken注解，刷新前端csrftoken(防止重复提交)，在ajaxPost的error中处理刷新后的csrftoken，回填到页面。\n\n##实例\n用户编辑，用户编辑前刷新csrftoken,提交时校验，如果多次提交，则弹出错误提示：\n`CSRF ERROR:无效的token，或者token过期`\n```java \n    @RefreshCSRFToken\n    @RequestMapping(method = RequestMethod.GET, value = \"/edit\")\n    private String edit(String id, HttpServletRequest request) {\n\n        request.setAttribute(\"id\", id);\n        return \"base/user/user_edit\";\n    }\n\n    @VerifyCSRFToken\n    @RequestMapping(method = RequestMethod.POST, value = \"/save\")\n    @ResponseBody\n    private Result saveUser(User user, HttpServletRequest request) {\n        if (StrUtil.isEmpty(user.getId())) {\n            String userId = userService.save(user).toString();\n            //头像和用户管理\n            userService.updateUserAvatar(user, request.getRealPath(\"/\"));\n        } else {\n            user.setUpdateDateTime(new Date());\n            userService.update(user);\n        }\n        return new Result(true);\n    }\n\n```\n','csrf',NULL,NULL,NULL,NULL),('8a8a826c5ac5e9a4015ac67d02e00001','2017-03-13 15:06:05',0,'2017-03-13 15:58:37',2,'render,fnRender,tooltip','AdminEAP框架数据列表render的五种方式','402880e456223e8f015625231d8e0003','##介绍\n在AdminEAP框架中，数据列表使用Bootstrap-DataTables组件（基于Jquery-DataTables）,在AdminEAP框架中进行二次封装，其中有些数据列需要在原来的数据基础上进行二次渲染，分别支持以下几种方式：\n- render （type=eq） 固定值的\'翻译\'\n- render (type=window) 弹出窗体\n- render (type=link)  超链接\n- tooltip 鼠标悬停提示\n- fnRender 渲染回调函数\n\n##xml配置示例\n以下是以上几个属性在xml配置中的示例和部分说明。\n```xml\n <query id=\"message_draft\" key=\"id\" tableName=\"我的草稿箱\" className=\"com.cnpc.tool.message.entity.Message\" widthType=\"px\">\n        <column key=\"rowIndex\" header=\"序号\" width=\"80\"/>\n        <column key=\"id\" header=\"id\" hidden=\"true\"/>\n        <column key=\"sendUser\" header=\"发送人\" hidden=\"true\" classType=\"String\" allowSort=\"false\" width=\"150\"/>\n        <!--enableTootip(是否显示) maxLen(最大长度默认10，可在dataTables.js修改默认值) tooltip（指定tooltip来源，可不配，缺省为本身） 长文本鼠标悬停显示-->\n        <!--弹窗方式render=\"type=window\"使用;所需参数同modals.openWin的参数-->\n        <!--<column key=\"sendSubject\" header=\"主题\" classType=\"String\" align=\"left\" render=\"type=window,winId=messageEditWin,url=/message/edit?id=[id],title=弹窗测试[sendSubject]\" enableTooltip=\"true\" maxLen=\"20\" allowSort=\"true\" width=\"150\"/>-->\n        <!--超链接方式 render=\"type=link\",method方法名称，params方法参数,分号;分隔，如不需要参数params为可为空，默认注入rowId-->\n        <!--<column key=\"sendSubject\" header=\"主题\" classType=\"String\" align=\"left\" render=\"type=link,method=loadPage,params=\'/message/edit?id=[id]\';\'#contentBody\'\" enableTooltip=\"true\" maxLen=\"20\" allowSort=\"true\" width=\"150\"/>-->\n        <column key=\"sendSubject\" header=\"主题\" classType=\"String\" align=\"left\" render=\"type=link,method=showDetail\" enableTooltip=\"true\" maxLen=\"20\" allowSort=\"true\" width=\"150\"/>    \n        <column key=\"sendTime\" header=\"发送时间\" classType=\"Date\" allowSort=\"true\" dateFormat=\"yyyy-mm-dd hh:ii\"  operator=\"between\" width=\"150\"/>\n        <column key=\"messageType\" header=\"类型\" classType=\"String\" align=\"left\" width=\"50\" fnRender=\"fnRenderMessageType\"/>\n        <!--isServerCondition=true value=0注入服务器端查询条件，也可在前端以type=hidden隐藏域的方式注入-->\n        <column key=\"messageStatus\" header=\"状态\" isServerCondition=\"true\" value=\"0\" classType=\"String\" allowSort=\"false\" width=\"50\" fnRender=\"fnRenderMessageStatus\"/>\n        <column key=\"messageFlag\" header=\"标记\" classType=\"String\" allowSort=\"true\" width=\"150\" fnRender=\"fnRenderMessageFlag\"/>\n        <column key=\"fileIds\" header=\"附件\" classType=\"String\" width=\"150\" fnRender=\"fnRenderFileIds\"/>     \n		  <!--<column key=\"deleted\" header=\"是否删除\" classType=\"String\" allowSort=\"true\" width=\"150\" render=\"0=可用,1=禁用\"/>-->\n    </query>\n```\n\n## 使用说明\n\n### render(type=eq) \n示例：\n(1) render=\"type=eq,0=可用，1=禁用\" (其中type=eq可缺省)\n(2) render=\"1=禁用,else=可用\"\n配置以后，组件会把相应值翻译为对应值。\n\n`type=eq` eq类型的render,可缺省\n\n### render(type=window)\n配置后，点击该列值，会弹出一个模态窗体，将配置的所有参数传递给modals.openWin方法。\n示例：\n(1) render=\"type=window,winId=messageEditWin,url=/message/edit?id=[id],title=弹窗测试[sendSubject]\n\n其中[id]，[sendSubject]会被替换为当前行对象的该列的值，是指定列（column key=\'id\'和column key=\'sendSubject\'）的值\n\n`type=window`:窗体render,必配\n`winId`:窗体id,必配\n`url`:url路径,必配\n\n其他参数通modals.openWin参数，如width等等\n\n###render(type=link)\n配置某列的超链接。配置形式是调用onclick方法，建议比较复杂的超链接采用这种配置。\n示例：\n(1) render=\"type=link,method=loadPage,params=\'/message/edit?id=[id]\';\'#contentBody\'\"\n(2) render=\"type=link,method=showDetail\"\n\n其中[id]会被替换为当前行对象的该列的值，是指定列（column key=\'id\'）的值\n\n`type=link`:超链接render,必配\n`method`:超链接执行方法名称，必配\n`params`：方法执行参数，分号(`;`)分隔,若缺省，会自动将当前行`id`注入方法，及query key执行的值\n\n`需要注意的是`，前台需要相对应的js方法，比如，以上两个实例需要前端由loadPage(url)和shoWDetail(rowId)方法。\n\n###fnRender\n更复杂的前端展示和业务逻辑，需要在前端编写相应的业务逻辑\n示例：\n（1）：fnRender=\"fnRenderMessageStatus\"\n\n对应前端脚本\n```\nfunction fnRenderMessageStatus(value, type, rowObj，oSetting) {\n    if (value == 0) {\n        return \'<span class=\"label label-warning\">草稿</span>\'\n    } else if (value == 4) {\n        return \'<span class=\"label label-success\">已发送</span>\';\n    }\n    return value;\n}\n```\n指定的fnRender方法中会通过Jquery-DataTables接口自动注入四个参数\n\n`value`: 当前单元格的值\n`type`:单元格样式，一般为display\n`rowObj`:当前行对象，可通过rowObj.name等形式获取其他列的值\n`oSetting`:表格全局配置对象\n\n###tooltip\n在表格中显示长文本的时候，有时候需要截断，然后鼠标悬停时显示，可采用该配置\n\n示例：\n（1）enableTooltip=\"true\" maxLen=\"20\" tooltip=\"id\"\n（`后续将修改成 render=\"type=tooltip,maxLen=20,tooltip=[id]\"`）\n\n`enableTooltip`:默认为false，只有配置true才生效，才会执行截断\n`maxLen`:截断长度，如果不配置，默认为20\n`tooltip`:鼠标悬停的数据来源，如不配默认为当前数据本身\n\n\n\n\n\n\n\n\n\n\n      ','render',NULL,NULL,NULL,NULL),('8a8a83295a8300ff015a839845890000','2017-02-28 15:21:19',0,'2017-02-28 15:21:19',0,'quartz,自动任务,支持集群','基于Quartz的自动任务调度器（支持集群）','402880e456223e8f015625231d8e0003','本文介绍在AdminEAP框架中，集成Quartz，来进行自动任务管理，以便随时监控系统中当前的任务，并能在线新增任务、暂停任务、恢复任务、删除任务、立即运行任务。\n\n在quartz中一个trigger可对应一个job，job可以有多个trigger，trigger分为CronTrigger与SimpleTrigger；CronTrigger通过Cron表达式配置定时任务，SimpleTrigger则配置一些简单重复的定时任务。\n\nquartz分为基于内存的方式和基于数据库的方式，在本文中使用了基于数据库的方式（支持集群）。这样提高了系统的可靠性，在配置时，请保持应用服务器的时钟同步。\n\n关于具体集成quartz的步骤，可参考AdminEAP源码，也可参考本人之前的博客：\n\n-  [ Spring+监听器+Quartz集群（1）——基本配置 ](http://blog.csdn.net/jrn1012/article/details/45582985)\n- [ Spring+监听器+Quartz集群（2）——quartz2.2.1创建表结构（oracle） ](http://blog.csdn.net/jrn1012/article/details/45583731)\n- [ Spring+监听器+Quartz集群（3）——任务管理 ](http://blog.csdn.net/jrn1012/article/details/45583801)\n\n以下为实现的任务调度管理器：\n\n![任务调度器](http://img.blog.csdn.net/20170228145717110?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n##使用说明\n\nAdminEAP框架使用mysql数据库，所以要在mysql中创建quartz所需要的表。\n###1、mysql创建表结构\n\n```\n    --  \n    -- A hint submitted by a user: Oracle DB MUST be created as \"shared\" and the   \n    -- job_queue_processes parameter  must be greater than 2  \n    -- However, these settings are pretty much standard after any  \n    -- Oracle install, so most users need not worry about this.  \n    --  \n    -- Many other users (including the primary author of Quartz) have had success  \n    -- runing in dedicated mode, so only consider the above as a hint ;-)  \n    --  \n      \n    delete from qrtz_fired_triggers;  \n    delete from qrtz_simple_triggers;  \n    delete from qrtz_simprop_triggers;  \n    delete from qrtz_cron_triggers;  \n    delete from qrtz_blob_triggers;  \n    delete from qrtz_triggers;  \n    delete from qrtz_job_details;  \n    delete from qrtz_calendars;  \n    delete from qrtz_paused_trigger_grps;  \n    delete from qrtz_locks;  \n    delete from qrtz_scheduler_state;  \n      \n    drop table qrtz_calendars;  \n    drop table qrtz_fired_triggers;  \n    drop table qrtz_blob_triggers;  \n    drop table qrtz_cron_triggers;  \n    drop table qrtz_simple_triggers;  \n    drop table qrtz_simprop_triggers;  \n    drop table qrtz_triggers;  \n    drop table qrtz_job_details;  \n    drop table qrtz_paused_trigger_grps;  \n    drop table qrtz_locks;  \n    drop table qrtz_scheduler_state;  \n      \n    -- 存储每一个已配置的 Job 的详细信息  \n    CREATE TABLE qrtz_job_details  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        JOB_NAME  VARCHAR2(200) NOT NULL,  \n        JOB_GROUP VARCHAR2(200) NOT NULL,  \n        DESCRIPTION VARCHAR2(250) NULL,  \n        JOB_CLASS_NAME   VARCHAR2(250) NOT NULL,   \n        IS_DURABLE VARCHAR2(1) NOT NULL,  \n        IS_NONCONCURRENT VARCHAR2(1) NOT NULL,  \n        IS_UPDATE_DATA VARCHAR2(1) NOT NULL,  \n        REQUESTS_RECOVERY VARCHAR2(1) NOT NULL,  \n        JOB_DATA BLOB NULL,  \n        CONSTRAINT QRTZ_JOB_DETAILS_PK PRIMARY KEY (SCHED_NAME,JOB_NAME,JOB_GROUP)  \n    );  \n    --  存储已配置的 Trigger 的信息  \n    CREATE TABLE qrtz_triggers  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        JOB_NAME  VARCHAR2(200) NOT NULL,   \n        JOB_GROUP VARCHAR2(200) NOT NULL,  \n        DESCRIPTION VARCHAR2(250) NULL,  \n        NEXT_FIRE_TIME NUMBER(13) NULL,  \n        PREV_FIRE_TIME NUMBER(13) NULL,  \n        PRIORITY NUMBER(13) NULL,  \n        TRIGGER_STATE VARCHAR2(16) NOT NULL,  \n        TRIGGER_TYPE VARCHAR2(8) NOT NULL,  \n        START_TIME NUMBER(13) NOT NULL,  \n        END_TIME NUMBER(13) NULL,  \n        CALENDAR_NAME VARCHAR2(200) NULL,  \n        MISFIRE_INSTR NUMBER(2) NULL,  \n        JOB_DATA BLOB NULL,  \n        CONSTRAINT QRTZ_TRIGGERS_PK PRIMARY KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP),  \n        CONSTRAINT QRTZ_TRIGGER_TO_JOBS_FK FOREIGN KEY (SCHED_NAME,JOB_NAME,JOB_GROUP)   \n          REFERENCES QRTZ_JOB_DETAILS(SCHED_NAME,JOB_NAME,JOB_GROUP)   \n    );  \n    -- 存储简单的 Trigger，包括重复次数，间隔，以及已触的次数  \n    CREATE TABLE qrtz_simple_triggers  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        REPEAT_COUNT NUMBER(7) NOT NULL,  \n        REPEAT_INTERVAL NUMBER(12) NOT NULL,  \n        TIMES_TRIGGERED NUMBER(10) NOT NULL,  \n        CONSTRAINT QRTZ_SIMPLE_TRIG_PK PRIMARY KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP),  \n        CONSTRAINT QRTZ_SIMPLE_TRIG_TO_TRIG_FK FOREIGN KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)   \n        REFERENCES QRTZ_TRIGGERS(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)  \n    );  \n    -- 存储 Cron Trigger，包括 Cron 表达式和时区信息  \n    CREATE TABLE qrtz_cron_triggers  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        CRON_EXPRESSION VARCHAR2(120) NOT NULL,  \n        TIME_ZONE_ID VARCHAR2(80),  \n        CONSTRAINT QRTZ_CRON_TRIG_PK PRIMARY KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP),  \n        CONSTRAINT QRTZ_CRON_TRIG_TO_TRIG_FK FOREIGN KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)   \n          REFERENCES QRTZ_TRIGGERS(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)  \n    );  \n    CREATE TABLE qrtz_simprop_triggers  \n      (            \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        STR_PROP_1 VARCHAR2(512) NULL,  \n        STR_PROP_2 VARCHAR2(512) NULL,  \n        STR_PROP_3 VARCHAR2(512) NULL,  \n        INT_PROP_1 NUMBER(10) NULL,  \n        INT_PROP_2 NUMBER(10) NULL,  \n        LONG_PROP_1 NUMBER(13) NULL,  \n        LONG_PROP_2 NUMBER(13) NULL,  \n        DEC_PROP_1 NUMERIC(13,4) NULL,  \n        DEC_PROP_2 NUMERIC(13,4) NULL,  \n        BOOL_PROP_1 VARCHAR2(1) NULL,  \n        BOOL_PROP_2 VARCHAR2(1) NULL,  \n        CONSTRAINT QRTZ_SIMPROP_TRIG_PK PRIMARY KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP),  \n        CONSTRAINT QRTZ_SIMPROP_TRIG_TO_TRIG_FK FOREIGN KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)   \n          REFERENCES QRTZ_TRIGGERS(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)  \n    );  \n    -- Trigger 作为 Blob 类型存储(用于 Quartz 用户用 JDBC 创建他们自己定制的 Trigger 类型，<span style=\"color:#800080;\">JobStore</span> 并不知道如何存储实例的时候)  \n    CREATE TABLE qrtz_blob_triggers  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        BLOB_DATA BLOB NULL,  \n        CONSTRAINT QRTZ_BLOB_TRIG_PK PRIMARY KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP),  \n        CONSTRAINT QRTZ_BLOB_TRIG_TO_TRIG_FK FOREIGN KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)   \n            REFERENCES QRTZ_TRIGGERS(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)  \n    );  \n    -- 以 Blob 类型存储 Quartz 的 Calendar 信息  \n    CREATE TABLE qrtz_calendars  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        CALENDAR_NAME  VARCHAR2(200) NOT NULL,   \n        CALENDAR BLOB NOT NULL,  \n        CONSTRAINT QRTZ_CALENDARS_PK PRIMARY KEY (SCHED_NAME,CALENDAR_NAME)  \n    );  \n    -- 存储已暂停的 Trigger 组的信息   \n    CREATE TABLE qrtz_paused_trigger_grps  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        TRIGGER_GROUP  VARCHAR2(200) NOT NULL,   \n        CONSTRAINT QRTZ_PAUSED_TRIG_GRPS_PK PRIMARY KEY (SCHED_NAME,TRIGGER_GROUP)  \n    );  \n    -- 存储与已触发的 Trigger 相关的状态信息，以及相联 Job 的执行信息  \n    CREATE TABLE qrtz_fired_triggers   \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        ENTRY_ID VARCHAR2(95) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        INSTANCE_NAME VARCHAR2(200) NOT NULL,  \n        FIRED_TIME NUMBER(13) NOT NULL,  \n        PRIORITY NUMBER(13) NOT NULL,  \n        STATE VARCHAR2(16) NOT NULL,  \n        JOB_NAME VARCHAR2(200) NULL,  \n        JOB_GROUP VARCHAR2(200) NULL,  \n        IS_NONCONCURRENT VARCHAR2(1) NULL,  \n        REQUESTS_RECOVERY VARCHAR2(1) NULL,  \n        CONSTRAINT QRTZ_FIRED_TRIGGER_PK PRIMARY KEY (SCHED_NAME,ENTRY_ID)  \n    );  \n    -- 存储少量的有关 Scheduler 的状态信息，和别的 Scheduler 实例(假如是用于一个集群中)  \n    CREATE TABLE qrtz_scheduler_state   \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        INSTANCE_NAME VARCHAR2(200) NOT NULL,  \n        LAST_CHECKIN_TIME NUMBER(13) NOT NULL,  \n        CHECKIN_INTERVAL NUMBER(13) NOT NULL,  \n        CONSTRAINT QRTZ_SCHEDULER_STATE_PK PRIMARY KEY (SCHED_NAME,INSTANCE_NAME)  \n    );  \n    -- 存储程序的悲观锁的信息(假如使用了悲观锁)  \n    CREATE TABLE qrtz_locks  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        LOCK_NAME  VARCHAR2(40) NOT NULL,   \n        CONSTRAINT QRTZ_LOCKS_PK PRIMARY KEY (SCHED_NAME,LOCK_NAME)  \n    );  \n      \n    create index idx_qrtz_j_req_recovery on qrtz_job_details(SCHED_NAME,REQUESTS_RECOVERY);  \n    create index idx_qrtz_j_grp on qrtz_job_details(SCHED_NAME,JOB_GROUP);  \n      \n    create index idx_qrtz_t_j on qrtz_triggers(SCHED_NAME,JOB_NAME,JOB_GROUP);  \n    create index idx_qrtz_t_jg on qrtz_triggers(SCHED_NAME,JOB_GROUP);  \n    create index idx_qrtz_t_c on qrtz_triggers(SCHED_NAME,CALENDAR_NAME);  \n    create index idx_qrtz_t_g on qrtz_triggers(SCHED_NAME,TRIGGER_GROUP);  \n    create index idx_qrtz_t_state on qrtz_triggers(SCHED_NAME,TRIGGER_STATE);  \n    create index idx_qrtz_t_n_state on qrtz_triggers(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP,TRIGGER_STATE);  \n    create index idx_qrtz_t_n_g_state on qrtz_triggers(SCHED_NAME,TRIGGER_GROUP,TRIGGER_STATE);  \n    create index idx_qrtz_t_next_fire_time on qrtz_triggers(SCHED_NAME,NEXT_FIRE_TIME);  \n    create index idx_qrtz_t_nft_st on qrtz_triggers(SCHED_NAME,TRIGGER_STATE,NEXT_FIRE_TIME);  \n    create index idx_qrtz_t_nft_misfire on qrtz_triggers(SCHED_NAME,MISFIRE_INSTR,NEXT_FIRE_TIME);  \n    create index idx_qrtz_t_nft_st_misfire on qrtz_triggers(SCHED_NAME,MISFIRE_INSTR,NEXT_FIRE_TIME,TRIGGER_STATE);  \n    create index idx_qrtz_t_nft_st_misfire_grp on qrtz_triggers(SCHED_NAME,MISFIRE_INSTR,NEXT_FIRE_TIME,TRIGGER_GROUP,TRIGGER_STATE);  \n      \n    create index idx_qrtz_ft_trig_inst_name on qrtz_fired_triggers(SCHED_NAME,INSTANCE_NAME);  \n    create index idx_qrtz_ft_inst_job_req_rcvry on qrtz_fired_triggers(SCHED_NAME,INSTANCE_NAME,REQUESTS_RECOVERY);  \n    create index idx_qrtz_ft_j_g on qrtz_fired_triggers(SCHED_NAME,JOB_NAME,JOB_GROUP);  \n    create index idx_qrtz_ft_jg on qrtz_fired_triggers(SCHED_NAME,JOB_GROUP);  \n    create index idx_qrtz_ft_t_g on qrtz_fired_triggers(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP);  \n    create index idx_qrtz_ft_tg on qrtz_fired_triggers(SCHED_NAME,TRIGGER_GROUP);  \n```\n###2、创建SimpleTrigger任务\n![SimpleTrigger任务](http://img.blog.csdn.net/20170228145913674?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n创建SimpleTrigger任务不用指定Cron表达式，可根据重复类型填写相应的重复次数与重复间隔（可以任务重复次数repeatCount与重复间隔repeatInterval是为重复类型指定参数）。\n\n###3、创建CronTrigger任务\n![CronTrigger任务](http://img.blog.csdn.net/20170228150302971?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\nCronTrigger任务则是通过Cron表达式创建的任务，只需要在界面配置必填选项和Cron表达式即可。\n\n###4、修改任务\n点击修改任务后，可进入到任务编辑界面，修改任务相关参数（任务名和任务组不可修改）。系统会通过rescheduleJob方法重新调度。\n\n```\n     // trigger已经存在，更新相应的定时设置\n     TriggerBuilder triggerBuilder = trigger.getTriggerBuilder();\n     trigger = setTriggerParam(job, triggerKey, triggerBuilder, trigger);\n     // 按新的trigger重新设置job执行\n     scheduler.rescheduleJob(triggerKey, trigger);\n```\n\n###5、暂停任务\n点击暂停任务，任务将挂起，任务状态由\"NORMAL\"变为“PAUSE”\n\n```java\n      /**\n     * 暂停\n     */\n    public void pauseJob(ScheduleJob scheduleJob) throws SchedulerException {\n        Scheduler scheduler = schedulerFactoryBean.getScheduler();\n        JobKey jobKey = JobKey.jobKey(scheduleJob.getJobName(), scheduleJob.getJobGroup());\n        scheduler.pauseJob(jobKey);\n    }\n\n```\n\n###6、恢复任务\n点击回复任务，任务将变为可执行状态，任务状态由\"PAUSE\"变为“NORMAL”\n\n```\n  /**\n     * 恢复运行\n     */\n    public void resumeJob(ScheduleJob scheduleJob) throws SchedulerException {\n        Scheduler scheduler = schedulerFactoryBean.getScheduler();\n        JobKey jobKey = JobKey.jobKey(scheduleJob.getJobName(), scheduleJob.getJobGroup());\n        scheduler.resumeJob(jobKey);\n    }\n\n```\n\n###7、删除任务\n从数据库中删除任务\n\n```\n    /**\n     * 删除\n     */\n    public void deleteJob(ScheduleJob scheduleJob) throws SchedulerException {\n        Scheduler scheduler = schedulerFactoryBean.getScheduler();\n        JobKey jobKey = JobKey.jobKey(scheduleJob.getJobName(), scheduleJob.getJobGroup());\n        scheduler.deleteJob(jobKey);\n    }\n```\n    \n\n###8、立即运行一次\n点击“立即运行一次”，任务则马上执行一次\n```\n    /**\n     * 运行一次\n     */\n    public void triggerJob(ScheduleJob scheduleJob) throws SchedulerException {\n        Scheduler scheduler = schedulerFactoryBean.getScheduler();\n        JobKey jobKey = JobKey.jobKey(scheduleJob.getJobName(), scheduleJob.getJobGroup());\n        scheduler.triggerJob(jobKey);\n    }\n\n```\n\n\n\n\n','quartz',NULL,NULL,NULL,NULL);
