INSERT INTO `tbl_message` VALUES ('8a8a81e55c1a3b6f015c1a971d680001','2017-05-18 16:05:30',0,'2017-05-18 16:05:30',0,'0','0','0',NULL,NULL,'<p>test<br></p>','test',NULL,'billJiang-test','402880e456223e8f015625231d8e0003','8a8a81e55c1a3b6f015c1a965c6c0000','402880e55a998466015a998e208d0003','0'),('8a8a84995ab64a5c015ab64b8af10000','2017-03-10 11:38:08',0,'2017-03-12 09:40:28',2,'0','4','0,1',NULL,NULL,'<p>test2<br></p>','商办唱主角北京房地产市场新格局商办唱主角北京房地产市场新格局AdminEAP框架消息管理系统','2017-03-12 09:40:28','billJiang-test','402880e456223e8f015625231d8e0003','402880ed5abbe288015abc3e1c3c0002,402880ed5abdfec1015ac02c71f10001,402880ed5abdfec1015ac02c71f50002,402880ed5abdfec1015ac02c71f80003','4028818458d40f4f0158d4169f9d0007,402880e65a7facdb015a7fca61830000,402880e456223e8f0156225736a40001,402880e456223e8f0156223feee10000,402880e456223e8f015625231d8e0003','1'),('8a8a84995ab654d1015ab675cf830009','2017-03-10 12:24:18',0,'2017-03-10 12:24:18',0,'0','0','0,1',NULL,NULL,'<p>\n<h1>北京市局全力服务城市副中心建设</h1>\n\n<br>\n</p><p>据了解，市工商局党组成员此前多次到北京城市副中心开展调查研究，深入一线指导基层工商部门的工作，现场解决基层遇到的难点和问题。据悉，市工商局制定的措施包括，加强城市副中心执法机构设置，从组织上推进基层执法力量落实到乡镇；充分利用工商数据资源，为服务副中心发展和市场监管提供数据支撑，提供副中心市场主体发展报告；在实行城六区产业禁限目录的基础上，支持出台更加严格的产业禁限政策，提升副中心市场主体质量，推动副中心产业转型升级；充分发挥京津冀三地工商和市场监管协作平台作用，加强三地基层工商和市场监管部门情报交流、信息共享和执法协作。\n\n<br></p>','北京市局全力服务城市副中心建设',NULL,'billJiang-test','402880e456223e8f015625231d8e0003','8a8a84995ab654d1015ab6759e960007,8a8a84995ab654d1015ab6759e9e0008','402880e55a998466015a998e208d0003','0'),('8a8a84995ab654d1015ab69aa7e8000c','2017-03-10 13:04:33',0,'2017-03-10 13:04:33',0,'1','0','0,1',NULL,NULL,'<p>\n<p>在北京新房供应锐减、价格不断攀升的情况下，商住两用楼盘成为一年多来北京楼市的焦点，对于购房者来说，低总价的商住两用俨然已成为先“上车”的无奈之选。数据显示，2月北京商品房成交中，近六成为商办类楼盘，入市的商办类楼盘均表现较好。实际上，自2016年二季度开始，关于商住全面限购的传闻不断，自此商住市场成交也进入快车道。业内认为，限购政策、大量购房需求的存在、北京新房市场中低价位产品的匮乏以及调控预期的刺激是商办类市场成交火热的主要原因。</p>\n<p>&nbsp; &nbsp; <strong>商办成楼市主角</strong></p>\n<p>&nbsp; &nbsp; 2014年夏天，小郭从北京某高校毕业后选择留京工作，进入一家互联网公司，开始了“北漂”的日子。能在北京安个家，是小郭一直的心愿。对于他来说，安家就需要买房。2016年9月，毕业两年后，小郭有了点积蓄，再加上家里能拿出一部分钱，小郭开始筹备购房的事情。</p>\n<p>&nbsp; &nbsp; 当时，恰逢“9·30”新政出台，房地产市场成交开始放缓，小郭就决定等2016年底或者2017年再说。数月时间过去了，在小郭看来，房地产市场虽然成交放缓了，但价格还是很稳定的，再加上之前联系的销售人员都在说房地产价格不会出现下跌，想到从自己读书开始到现在，北京的房价涨了几倍，小郭突然有了一种想法：“如果再不买房的话，可能再也上不了车了。”</p>\n<p>&nbsp; &nbsp; 春节过后，小郭下定了买房的决心。因为北京的限购政策，小郭暂时不具备购买70年住宅的资质，因此，市场中存在的商住房成为小郭惟一的选择。2月，在市场中兜兜转转看了许多个在售商住项目后，小郭在大兴区某商住项目购买了一套LOFT房屋。</p>\n<p>&nbsp; &nbsp; 北京商报记者在走访市场时了解到，类似小郭这种情况的购房者并不在少数，在经过一段时间观望后，购房者的集中入市，导致2月下旬北京房地产市场阶段性回温。值得注意的是，根据统计数据显示，2月北京商品房成交量中，近六成为商办类楼盘，去年同期的商办成交占比还不到四成。</p>\n<p>&nbsp; &nbsp; 实际上，2016年是北京商住市场成交最热的一年。据统计，2016年北京商住市场共计成交63703套，这一成交总量超过了之前三年的总和。有数据显示，2010-2015年期间，北京商住公寓项目的成交量相对平稳；除2014年因市场降温而下滑至1.3万套以外，其余几年的成交套数均维持在2万-3万套之间。</p>\n<p>&nbsp; &nbsp; 有业内人士分析认为，一直以来，商住房都是作为房地产市场的一种补充产品存在着，不过在2016年上半年，北京商住房成交量首次超过住宅，随后商住房市场经历过几次起伏，但是，在北京纯住宅供应较少的情况下，商住房开始超过住宅产品成为北京楼市的主角，这也成为目前北京楼市的特点之一。</p>\n<p>&nbsp; &nbsp; <strong>多因素叠加效应</strong></p>\n<p>&nbsp; &nbsp; “北京商住房的‘上位’并非偶然”，一位从事房地产营销工作近十年的业内人士认为，北京市对纯住宅产品的限购政策、大量购房需求的存在、新房市场中低价位产品的匮乏以及调控预期的刺激是商住类市场成交火热的几个主要原因。</p>\n<p>&nbsp; &nbsp; 第一太平戴维斯华北区住宅销售部助理董事梁爽在接受北京商报记者采访时表示，商办类产品受使用成本高、土地年限短等条件限制，相比于住宅并没有优势，增值速度也低于普通住宅，然而受限购政策限制及北京楼市供给不足的影响，导致有自住及投资需求的客户都需要这种资产配置。因此，针对普通住宅的限购政策是商办成交火热的主要原因。</p>\n<p>&nbsp; &nbsp; 业内人士认为，除了针对普通住宅的限购政策之外，北京拥有中国最顶级的教育、医疗等资源，包括首次置业以及改善型置业的购房需求均较为旺盛。不仅如此，房地产是目前资产保值增值的一种重要工具，因此，北京房地产市场也存在一定规模的投资需求。同时，受限购政策影响，暂不具备购房资质的投资者就会流入商住房市场，这部分需求支撑着商住房市场的成交热度。</p>\n<p>&nbsp; &nbsp; 此外，北京新房市场中低价位产品的匮乏也是导致商住房走热的原因之一。近年来，北京市土地供应逐渐减少，2016年北京土地市场仅成交经营性用地（不包含3宗棚户区改造）28宗，备受关注的住宅类用地，仅成交15宗，其中可售纯商品住宅用地只有7宗，规划总建筑面积仅39万平方米。同时，土地成交价格不断攀升，地价高企导致北京新房市场豪宅化。因此，受到购房承受能力限制，低总价的商办类产品开始受到刚需购房者的青睐。</p>\n<p>&nbsp; &nbsp; 还有一个不得不提的原因是，关于商住房将全面限购的几度传闻。自2016年5月通州商住限购政策实施后，全市商住房将限购的消息几度传出，尽管政府部门曾辟谣，但开发商利用传言作为营销噱头，还是加速购房者涌入商住房市场。</p>\n\n<br></p>','商办唱主角 北京房地产市场新格局商办唱主角 北京房地产市场新格局',NULL,'billJiang-test','402880e456223e8f015625231d8e0003','8a8a84995ab654d1015ab69a75c0000a,8a8a84995ab654d1015ab69a75c7000b','402880e55a998466015a998e208d0003','0'),('8a8a84995ab654d1015ab69bebc7000f','2017-03-10 13:05:56',0,'2017-03-10 13:05:56',0,'1