div></li>\n						\n							<li><div>69%<br>最高降幅</div><div>2016年，数据库进行了<br>2次降价平均降幅39%，<br>最高降幅69%</div></li>\n						\n					</ul>\n					<div>\n						<div>他们都信任和选择阿里云数据库产品：</div>\n						<div>\n							\n								<div><img alt=\"\" src=\"https://img.alicdn.com/tps/TB1DkRYKXXXXXb0XpXXXXXXXXXX-140-140.png\"></div>\n							\n								<div><img alt=\"\" src=\"https://img.alicdn.com/tps/TB126T6KXXXXXc8XFXXXXXXXXXX-140-140.jpg\"></div>\n							\n								<div><img alt=\"\" src=\"https://img.alicdn.com/tps/TB12gchKXXXXXafXpXXXXXXXXXX-140-140.jpg\"></div>\n							\n								<div><img alt=\"\" src=\"http://pic.paopaoche.net/up/2015-3/201532141132.png\"></div>\n							\n								<div><img alt=\"\" src=\"https://img.alicdn.com/tps/TB1L6K8OVXXXXXoXpXXXXXXXXXX-256-256.png\"></div>\n							\n						</div>\n					</div>\n				</div>\n\n</p>','创意/想法','我了个天',NULL),('8a8a807a59633d0a0159634a98c50003','2017-01-03 15:45:50',0,'2017-01-03 15:45:50',0,'<p>test</p>','bug反馈','bill jiang的测试',NULL),('8a8a807a59634b280159634c1eb20000','2017-01-03 15:47:30',0,'2017-01-03 15:47:30',0,'<p>2017-01-03 15:46:50,132 [freemarker.cache]-[DEBUG] Could not find template in cache, creating new one; id=[\"homePage.html\"[\"zh_CN\",utf-8,parsed] ]<br>2017-01-03 15:46:50,134 [freemarker.cache]-[DEBUG] Compiling FreeMarker template \"homePage.html\"[\"zh_CN\",utf-8,parsed]  from \"C:\\\\work\\\\github\\\\AdminEAP\\\\AdminEAP-web\\\\src\\\\main\\\\webapp\\\\WEB-INF\\\\views\\\\homePage.html\"<br>2017-01-03 15:46:50,162 [freemarker.cache]-[DEBUG] \"homePage.html\"[\"zh_CN\",utf-8,parsed]  cached copy not yet stale; using cached.<br><a href=\"http://127.0.0.1:8080/AdminEAP/message/mail/edit\">http://127.0.0.1:8080/AdminEAP/message/mail/edit</a>﻿<br></p>','创意/想法','bill jiang的测试','jrn1012@petrochina.com.cn'),('8a8a80a0593fa68f01593fb4374b0000','2016-12-27 17:54:52',0,'2016-12-27 17:54:52',0,'<p> \n<h1>1. 计费方法</h1><p>邮件推送产品（Direct Mail）计费方法是按照邮件发送量计费，目前有两种付费方式：资源包、按量付费。</p>\n<ul>\n<li><p>邮件发送量：指邮件推送为用户发送的邮件总量。</p>\n</li><li><p>一封邮件的定义为：发送至一个电子邮件地址的一次电子邮件通信。发送给多个收件人的一次电子邮件通信将视为分别向每个收件人发送一封邮件。</p>\n</li></ul>\n<h2><a target=\"_blank\" rel=\"nofollow\"></a>1.1 资源包</h2><ol>\n<li>资源包是预付费方式，支付费用购买成功后，资源包立即生效。</li><li>购买时长（即有效期）：6个月。每个资源包的有效期独立计算，多个资源包有效期不会叠加。</li><li>扣减方式：购买的资源包在有效期内，优先抵扣资源包内的邮件量，多个资源包按有效期先结束的优先扣减，当所有资源包扣减完毕后，自动转为按量计费的方式扣减。</li><li><strong>资源包使用后或资源包到期后，剩余流量不支持退订、不支持退款。</strong></li></ol>\n\n<br></p>','意见/建议','test1234567',NULL),('8a8a81d65a3ba9a5015a3c23fe7d0000','2017-02-14 18:21:16',0,'2017-02-14 18:21:16',0,'<p>test<br></p>','bug反馈','test','test'),('8a8a81d65a3c252f015a3c25e0350000','2017-02-14 18:23:19',0,'2017-02-14 18:23:19',0,'<p>test<br></p>','意见/建议','test1','test'),('8a8a81d65a3c285d015a3c28e0c80000','2017-02-14 18:26:36',0,'2017-02-14 18:26:36',0,'<p>ffff<br></p>','意见/建议','test1233434534','test1'),('ff8081816063d86f016063e1e3c50000','2017-12-17 17:50:36',NULL,'2017-12-17 17:50:36',0,'<p>fdfdfd<br></p>','意见/建议','localhost','localhost');
